import { MongoClient, ObjectID } from 'mongodb';
import task from "./model";
import mongoose from "mongoose";

const url = 'mongodb://localhost:27017';
const dbName = 'taskDB';
mongoose.connect (url+'/'+dbName);

const taskControler = {
    get: function (request, response) {
        task.find()
        .then(inf=>{
                response.send(inf);
        })
        .catch(
            error=>{
                response.status(500).send(error);
            }
        );
    },

    getByAandB: function(req, res) {
        const A = req.query.A;
        const B = req.query.B;
        task.find({"storeName": A} || {"stockNumber": B})
        .then((elems) => {
            res.send(elems);
        })
    },

    post: function(request, response) {
        const newItem = new task(request.body);
        newItem.save()
        .then(inf=>{
            response.send(inf);    
        }).catch(
            error=>{
                response.status(500).send(error);
            });
    },

    deleteById: function(req, res) {
        if (req.query.id) {
            task.findByIdAndDelete(req.query.id)
            .then((deleted) => {
                res.send(deleted);
            })

        }
    }
}

export default taskControler;

